            {#</button>#}
            {#</p>#}
            {#<div class=\"collapse\" id=\"rechercheSolo\">#}
            {{ form_start(searchForm, {'method': 'GET', 'attr': {'class': 'formSearch'} }) }}

            <div class=\"form-group\">
                {{ form_row(searchForm.titre_livre) }}
            </div>
            <div class=\"form-group\">
                {{ form_row(searchForm.auteur) }}
            </div>
            <div class=\"form-group\">
                {{ form_row(searchForm.filiere) }}
            </div>
            <div class=\"form-group\">
                {{ form_row(searchForm.categorie, {'attr': {'class': 'inline-block'} }) }}
            </div>
            <div class=\"form-group\">
                {{ form_row(searchForm.submit, {'attr': {'class': 'btn btn-lg btn-dark'} }) }}
            </div>

            {{ form_end(searchForm) }}


        </div>
    </div>
    {% block resultat %}
    {% endblock %}

{% endblock %}", "search/livre.html.twig", "C:\\wamp64\\www\\bookcatalogue\\templates\\search\\livre.html.twig");
